import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Button from '@material-ui/core/Button';
import Box from '@material-ui/core/Box';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

export default function ButtonAppBar() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="static" style={{ background: 'transparent', boxShadow: 'none'}} >
        <Box style={{}} display="flex" flexDirection="column">
          {/* <IconButton edge="start" className={classes.menuButton} color="inherit" aria-label="menu">
            <MenuIcon />
          </IconButton> */}
          <Box display="flex" justifyContent="center">
            <Typography variant="h5" className={classes.title} style={{color:'black'}} >
              MACH33 ENGINEERING
            </Typography>
          </Box>

          <Button color="inherit" variant="h6" style={{color:'black'}}>Home</Button>
          <Button color="inherit" variant="h6" style={{color:'black'}}>About</Button>
          <Button color="inherit" variant="h6" style={{color:'black'}}>Services</Button>
          <Button color="inherit" variant="h6" style={{color:'black'}}>Portfolio</Button>
          <Button color="inherit" variant="h6" style={{color:'black'}}>Contact Us</Button>
        </Box>
      </AppBar>
    </div>
  );
}
